void clear_screen(){
  for(int x = 0; x < 320; x++){
    for(int y = 0; y < 240; y++){
      plot_pixel(x, y, WHITE);
    }
  }
}

void delay(int count){
    while(count){
        count--;
    }
}

void draw_line(int x0, int y0, int x1, int y1, short int line_color){
  bool is_steep = ABS(y1 - y0) > ABS(x1 - x0);
  int temp = 0;
  int y_step = 0;
  if (is_steep){
    //swap x0 and y0
    temp = x0;
    x0 = y0;
    y0 = temp;
    //swap x1 and y1
    temp = x1;
    x1 = y1;
    y1 = temp;
  }
  if(x0 > x1){
    //swap x0 and x1
    temp = x0;
    x0 = x1;
    x1 = temp;
    //swap y0 and y1
    temp = y0;
    y0 = y1;
    y1 = temp;
  }

  int deltax = x1 - x0;
  int deltay = ABS(y1 - y0);
  int error = -(deltax / 2);
  int y = y0;

  if (y0 < y1){
    y_step = 1;
  }
  else{
    y_step = -1;
  }

  for(int x = x0; x < x1; x++){
    if (is_steep){
      plot_pixel(y, x, line_color);
    }
    else{
      plot_pixel(x, y, line_color);
    }

    error = error + deltay;
    if (error > 0){
      y = y + y_step;
      error = error - deltax;
    }
  }
}

void draw_poly(int num_vertices, int *vertices, short int color){
  for(int i=0;i<num_vertices-1;i++)
    {
      draw_line(vertices[(i<<1)+0],
           vertices[(i<<1)+1],
           vertices[(i<<1)+2],
           vertices[(i<<1)+3],
           color);
    }
    draw_line(vertices[0],
         vertices[1],
         vertices[(num_vertices<<1)-2],
         vertices[(num_vertices<<1)-1],
         color);
}

void wait_for_vsync(){
  volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
  int status = 0;
  //launch the swap process
  *pixel_ctrl_ptr = 1; //set S bit to 1
  //poll the status bit in the status register
  status = *(pixel_ctrl_ptr + 3);
  while ((status & 0x01) != 0) {
    status = *(pixel_ctrl_ptr + 3);
  }
  //done so exit
}

void write_char(int x, int y, char c) {
  // VGA character buffer
  volatile char * character_buffer = (char *) (0xC9000000 + (y<<7) + x);
  *character_buffer = c;
}


void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void draw_background(){
    for (int j = 0; j < 239; j++){
        for (int i = 0; i < 319; i++){
                int color_of_pixel =  background[j*474 + i];
                plot_pixel(i, j, convert_to_32_bits(color_of_pixel));
        }
    }
}

void draw_player_pos1(int x, int y, int mode){
    int* vector_local;
    int dim_x, dim_y;
    if(mode == 1){
        vector_local = boy_walk_1;
        dim_x = 59; dim_y = 89;
    }
    else if (mode == 2){
        vector_local = boy_walk_2;
        dim_x = 59; dim_y = 88;
    }
    else{
        vector_local = boy_walk_3;
        dim_x = 59; dim_y = 88;
    }
    for (int j = y; j < y + dim_y; j++){
        for (int i = x; i < x + dim_x; i++){
                int color_of_pixel =  vector_local[(j - y)*dim_x + (i - x)];
                plot_pixel(i, j, convert_to_32_bits(color_of_pixel));
        }
    }
}

void clear_player_pos1(int x, int y, int mode){
    int dim_x, dim_y;
    if(mode == 1){
        dim_x = 59; dim_y = 89;
    }
    else if (mode == 2){
        dim_x = 59; dim_y = 88;
    }
    else{
        dim_x = 59; dim_y = 88;
    }
    for (int j = y; j < y + dim_y; j++){
        for (int i = x; i < x + dim_x; i++){
                plot_pixel(i, j, WHITE);
        }
    }
}

short int convert_to_32_bits(int color){
    return (((color & 0xf80000)>>8) + ((color & 0xfc00)>>5) + ((color & 0xf8)>>3));
}

